import React, { Component } from 'react';
import logo from './comarca-logo-ok.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h1>
            Tienda de productos creados por emprendedores
          </h1>
          <p>Estamos creando nuestro sitio, mientras...</p>
          <a
            className="App-link"
            href="https://www.instagram.com/comarcadecreadores/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Visitá nuestro Instagram
          </a>
        </header>
      </div>
    );
  };
};

export default App;











